import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";
// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";

// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.jsx";
import GridItem from "components/Grid/GridItem.jsx";
import CustomInput from "components/CustomInput/CustomInput.jsx";
import Button from "components/CustomButtons/Button.jsx";

import workStyle from "assets/jss/material-kit-react/views/landingPageSections/workStyle.jsx";

class QuestionsSection extends React.Component {
  render() {
    const { classes } = this.props;
    return (
      <div className={classes.section}>
        <GridContainer justify="center">
          <GridItem cs={12} sm={12} md={8}>
            <h2 className={classes.title}>Primero, cuentanos sobre el paciente</h2>

            <h7 className={classes.title}>Cuentanos información que sea agradable para el paciente.
            Si no sabes alguna de las respuestas o no estas seguro, dejala vacía.</h7>
            <form>
              <GridContainer>

              <GridItem xs={12} sm={10} md={12}>
                <CustomInput
                  label="Label"
                  labelText="¿Ciudad dónde vive?"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Departamento dónde vive?"
                  id="department"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Barrio dónde vive?"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Dónde nació?"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Profesion que ejerció o ejerce"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Nombre de la escuela/universidad/instituto donde estudio"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Tiene un Sobrenombre?"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="¿Nombre de la pareja?"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Contrajo matrimonio"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />

                <CustomInput
                  labelText="Contrajo matrimonio"
                  id="city"
                  formControlProps={{
                  fullWidth: true
                  }}
                  inputProps={{
                  onChange: this.onChange,
                  type: "text",
                  }}
                />





              </GridItem>

              </GridContainer>


            </form>
          </GridItem>
        </GridContainer>
      </div>
    );
  }
}

QuestionsSection.propTypes = {
  classes: PropTypes.object
};

export default withStyles(workStyle)(QuestionsSection);
